script: |
  super -f text -I q9612.spq | sort > q9612.out

inputs:
  - name: q9612.spq
    data: |
      SELECT ALL - + col2 * col1 - - 69 - - col0 * col1 / + col1 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE ( NULL ) < - col1 + ( + col0 ) * + col0;
  - name: tab0

outputs:
  - name: q9612.out
    data: |
